import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices
    const extractedData = await page.evaluate(() => {
      const products = [];
      const productCards = document.querySelectorAll('.product-card');

      productCards.forEach(card => {
        const titleElement = card.querySelector('.product-title');
        const priceElement = card.querySelector('.product-price');

        if (titleElement && priceElement) {
          // Extract just the current price (ignore original price if present)
          const priceText = priceElement.textContent.trim();
          const currentPrice = priceText.split(/\s+/)[0]; // Get first price value

          products.push({
            title: titleElement.textContent.trim(),
            price: currentPrice
          });
        }
      });

      return products;
    });

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: { products: extractedData },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
